import { BrowserRouter, Route } from 'react-router-dom'; // Importing BrowserRouter once

import LoginP from './Pages/login'; // Corrected the component name to start with a capital letter

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path='/login' component={LoginP} /> {/* Pass the component reference directly */}
      </BrowserRouter>
    </div>
  );
}

export default App;
